import { Routes,Route, Outlet} from "react-router-dom";


const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I am the navigation bar</h1>
      </div>
      <Outlet />
    </div>
  )
};

const Shop = () => {
  return <h1>I am the shop page</h1>
};

const App = () => {
  return (
    <Routes>
      <Route path = '/' element={<Navigation />}>

      </Route>
      <Route path='/' element={<Home />}/>
    </Routes>
  )
};

export default App;
